import React, { Component } from "react";
import { connect } from "react-redux";
import { Link } from "react-router-dom";
import { TextField, FormControl, InputLabel, Select, MenuItem } from '@material-ui/core';
import { Row, Col } from "reactstrap"

class StoreHours extends Component {
    state = {
        age: ""
    }

    handleChange = (event) => {
        console.log(event.target.value)
    }

    render() {
        return <div className="container">
            <br />
            <Row>
                <Col><h5>Monday</h5></Col>
                <Col>

                    <FormControl variant="outlined" className={classes.formControl}>
                        <InputLabel id="demo-simple-select-outlined-label">Start Time</InputLabel>
                        <Select
                            labelId="demo-simple-select-outlined-label"
                            id="demo-simple-select-outlined"
                            value={age}
                            onChange={this.handleChange}
                            label="Age"
                        >
                            <MenuItem value="">
                                <em>None</em>
                            </MenuItem>
                            <MenuItem value={10}>Ten</MenuItem>
                            <MenuItem value={20}>Twenty</MenuItem>
                            <MenuItem value={30}>Thirty</MenuItem>
                        </Select>
                    </FormControl>

                </Col>
                <Col><TextField id="outlined-basic" fullWidth label="Longitude" variant="outlined" /></Col>
            </Row>
            <br />
        </div>
    }
}

const mapStateToProps = (state) => ({
    isAuthenticated: state.auth.isAuthenticated,
    auth: state.auth,
});

export default connect(mapStateToProps)(StoreHours);
